import React from "react";

const Banner = () =>{
  return (
    <div className={"banner"}>
      <div className={"banner__content"}>
        <p className={"banner__content__title"}>
          Đăng tin rao bất động sản
        </p>
        <p className={"banner__content__slogan"}>
          hiệu quả hơn bằng công nghệ số
        </p>
        <div style={{ border: "2px solid white", height: "50px", width: "200px", borderRadius: "25px", margin: "auto", fontSize: '25px' }}>
          Tìm hiểu thêm
        </div>
      </div>
    </div>
  )
};

export default Banner;
